import React from 'react';
import PropTypes from 'prop-types';

interface YoutubeThumbnailPropTypes {
  youtubeId: string;
  style?: React.CSSProperties;
}

export const YoutubeThumbnail = ({ youtubeId, style }: YoutubeThumbnailPropTypes) => <img
  style={style}
  src={`https://i3.ytimg.com/vi/${youtubeId ?? ''}/maxresdefault.jpg`}
  alt='YouTube thumbnail image'
  onError={(e) => {
    console.log(e);
    e.target.src = `https://i3.ytimg.com/vi/${youtubeId ?? ''}/sddefault.jpg`;
    e.target.onError = null;
  }}
/>;
